import React from 'react';
import PropTypes from 'prop-types';
import clsx from 'clsx';
import { withStyles } from '@material-ui/styles';
import {
    Card,
    CardHeader,
    CardContent,
    CardActions,
    Typography,
    Grid,
    Divider,
    Avatar
} from '@material-ui/core';
import { StatusBullet } from 'components';
import { URI } from './../../../../constants/types';
import styles from './styles';

const statusColors = {
    true: 'success',
    false: 'danger'
};

const PresencesCard = props => {
    const { className, classes } = props;
    return (
        <Card className={clsx(classes.root, className)}>
            <Grid container direction="row">
                <Grid item lg={4} md={4} xs={12}>
                    <CardHeader
                        avatar={
                            <Avatar
                                src={
                                    'http://www.gravatar.com/avatar/f8aef9003205946523250a062b54bbb6?s=200&r=pg&d=retro'
                                }
                            />
                        }
                        title={
                            <Typography variant="h5">
                                Mella Full Screen Slider
                            </Typography>
                        }
                        subheader={
                            <Typography variant="body2">by She Fen</Typography>
                        }
                    />
                </Grid>
                <Grid item xs>
                    <CardContent>
                        <Grid
                            container
                            direction="row"
                            //justify="space-between"
                            //alignItems="center"
                            //spacing={10}
                            //justify="space-between"
                        >
                            <Grid item lg={6} xs={12}>
                                <Grid container direction="row" spacing={2}>
                                    <Grid item>
                                        <Typography variant="h5">12</Typography>
                                        <Typography variant="body1">
                                            Chua biet
                                        </Typography>
                                    </Grid>
                                    <Grid item>
                                        <Typography variant="h5">12</Typography>
                                        <Typography variant="body1">
                                            Chua biet
