                                    </Grid>
                                </Grid>
                            </Grid>
                            <Grid item xs>
                                <Grid container direction="row" spacing={2}>
                                    <Grid item>
                                        <Typography variant="h5">12</Typography>
                                        <Typography variant="body1">
                                            Chua biet
                                        </Typography>
                                    </Grid>
                                    <Grid item>
                                        <Typography variant="h5">12</Typography>
                                        <Typography variant="body1">
                                            Chua biet
                                        </Typography>
                                    </Grid>
                                </Grid>
                            </Grid>
                            <Grid item>
                            </Grid>
                        </Grid>
                    </CardContent>
                </Grid>
            </Grid>
        </Card>
    );
};
export default withStyles(styles)(PresencesCard);
